JSBundleType:               html
JSBundleIdentifier:         io.breakside.DocViewerWeb
JSBundleVersion:            2020.3.0
JSCopyright:                .copyright
UIMainSpec:
  default:                  MainWindow
  touch:                    MainWindowTouch
UIApplicationTitle:         .applicationTitle
UIApplicationLaunchOptions:
  uistate: {kind: positional, default: null}
  others: {kind: unknown}
UIApplicationSystemFont:    SourceSansPro-Light
JSDevelopmentLanguage:      en
UIApplicationIcon:          Icon
UIApplicationEnvironment:
  name:                     DOCVIEWERWEB_ENV_NAME
  rollbarToken:             DOCVIEWERWEB_ROLLBAR_CLIENT_TOKEN
DockerOwner:                breakside
HMTLManifestConfiguration:
  - components-manifest.json
UIRoutes:
  -
    name: workspace
    url: "*workspace"
    children:
      -
        name: settings
        url: "_/settings"
      -
        name: project
        url: "*project"
        children:
          -
            name: settings
            url: settings